// src/components/AllShopsPage.jsx
import React from "react";

export default function AllShopsPage() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold">All Shops</h1>
      <p className="text-gray-600 mt-2">Here you will see all the listed barbershops.</p>
    </div>
  );
}
